import './App.css';
import { Route, Routes } from 'react-router-dom'
import Home from './pages/Home'
import Projects from './pages/Projects'

const App = () => {
  return (
    <div className="App">
      <Routes>
      <Route path="/" element={<Home />} /> 
      </Routes>
        {/* <Route path ="/project/:id" component = {Projects} /> */}
    </div>

  );
};

export default App;
